INSERT INTO `t_v_show` (`id`, `name`, `synopsis`, `image`) VALUES (6,'Game of Thrones','While a civil war brews between several noble families in Westeros, the children of the former rulers of the land attempt to rise to power.','tt0944947.jpg'),(7,'Dexter','Dexter Morgan is a Forensics Expert, a loyal brother, boyfriend, and friend. That\'s what he seems to be, but that\'s not what he really is. Dexter Morgan is a Serial Killer that hunts the bad.','tt0773262.jpg'),(8,'Westworld','A series inspired by the 1973 film of the same title written by Michael Crichton about a futuristic theme park populated by artificial beings.','tt0475784.jpg'),(9,'Stargate SG-1','A secret military team, SG-1, is formed to explore the recently discovered Stargates.','tt0118480.jpg'),(10,'Stargate: Atlantis','An international team of scientists and military personnel discover a Stargate network in the Pegasus Galaxy and come face-to-face with a new, powerful enemy, The Wraith.','tt0374455.jpg'),(11,'SGU Stargate Universe','Trapped on an Ancient spaceship billions of light years from home, a group of soldiers and civilians struggle to survive and find their way back to Earth.','tt1286039.jpg'),(12,'Breaking Bad','A high school chemistry teacher diagnosed with inoperable lung cancer turns to manufacturing and selling methamphetamine in order to secure his family\'s future.','tt0903747.jpg'),(13,'South Park','Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.','tt0121955.jpg'),(14,'The Simpsons','The satiric adventures of a working-class family in the misfit city of Springfield.','tt0096697.jpg'),(15,'Stranger Things','When a young boy disappears, his mother, a police chief, and his friends must confront terrifying forces in order to get him back.','tt4574334.jpg'),(16,'Lost','The survivors of a plane crash are forced to work together in order to survive on a seemingly deserted tropical island.','tt0411008.jpg'),(17,'24','Jack Bauer, Director of Field Ops for the Counter-Terrorist Unit of Los Angeles, races against the clock to subvert terrorist plots and save his nation from ultimate disaster.','tt0285331.jpg'),(18,'True Detective','An anthology series in which police investigations unearth the personal and professional secrets of those involved, both within and outside the law.','tt2356777.jpg'),(19,'SpongeBob SquarePants','The misadventures of a talking sea sponge who works at a fast food restaurant, attends a boating school, and lives in an underwater pineapple.','tt0206512.jpg'),(20,'House','An antisocial maverick doctor who specializes in diagnostic medicine does whatever it takes to solve puzzling cases that come his way using his crack team of doctors and his wits.','tt0412142.jpg'),(21,'Jessica Jones','A former superhero decides to reboot her life by becoming a private investigator.','tt2357547.jpg'),(22,'Daredevil','Matt Murdock, with his other senses superhumanly enhanced, fights crime as a blind lawyer by day, and vigilante by night.','tt3322312.jpg'),(23,'The Night Of','After a night of partying with a female stranger, a man wakes up to find her stabbed to death and is charged with her murder.','tt2401256.jpg'),(24,'CSI: Crime Scene Investigation','An elite team of police forensic evidence investigation experts work their cases in Las Vegas.','tt0247082.jpg'),(25,'CSI: NY','CSI Head Detective Mac Taylor and his team solve crimes in New York City.','tt0395843.jpg'),(26,'CSI: Miami','The cases of the Miami-Dade, Florida police department\'s Crime Scene Investigations unit.','tt0313043.jpg');
